import React from 'react';
import './About.css'

const About = () => {
    return (
        <div className='about_container'>
            <div className="about_container_adp">
                <div className="about_background">
                    <p className="about_first_name">Про нашу команду</p>
                </div>
            </div>
        </div>
    );
};

export default About;
